import React from 'react';
import { Route } from 'react-router-dom';

import VendorForm from './components/CourseGoals/CourseInput/VendorForm';
import './App.css';
import VList from './components/CourseGoals/CourseInput/VList';
import MainHeader from './components/CourseGoals/CourseInput/MainHeader';

const App = () => {


  return (
    <div>
      <MainHeader></MainHeader>
      <main>
        <Route path ="/VendorForm">
          <VendorForm />
        </Route>
        <Route path="/VList">
          <VList />
        </Route>
        </main>

    </div>
  );
};

export default App;
